import React from 'react';

const Legend = ({ colorScale }) => {
  const nodeTypes = [
    { type: 'theme', label: 'Theme (AI Generated)' },
    { type: 'feedback', label: 'Feedback' },
    { type: 'persona', label: 'User Role' }
  ];

  return (
    <div className="absolute top-4 right-4 bg-white p-3 rounded-lg shadow z-20">
      <h3 className="text-sm font-semibold mb-2">Legend</h3>
      <div className="space-y-2">
        {nodeTypes.map(item => (
          <div key={item.type} className="flex items-center">
            <div 
              className="w-4 h-4 rounded-full mr-2"
              style={{ backgroundColor: colorScale(item.type) }}
            ></div>
            <span className="text-xs">{item.label}</span>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Legend;
